
const data = [
  {
    question: ['data:image/png;base64,'],
    answer: ['data:image/png;base64,']
  },
  {
    question: ['data:image/png;base64,','data:image/png;base64,'],
    answer: ['data:image/png;base64,']
  },
  {
    question: ['data:image/png;base64,'],
    answer: ['data:image/png;base64,']
  }
];
let current = null;
function showQuestion() {
  const idx = Math.floor(Math.random() * data.length);
  current = data[idx];
  const qDiv = document.getElementById('question');
  qDiv.innerHTML = current.question.map(src => `<img src="${src}" alt="question">`).join('');
  document.getElementById('answer').style.display = 'none';
  document.getElementById('answer').innerHTML = current.answer.map(src => `<img src="${src}" alt="answer">`).join('');
}
function showAnswer() {
  document.getElementById('answer').style.display = 'block';
}
document.getElementById('showBtn').addEventListener('click', showAnswer);
document.getElementById('nextBtn').addEventListener('click', showQuestion);
showQuestion();
